import React, { component } from 'react'
import './App.css';
import HomePage from '../Home/Home';
import { BrowserRouter as Router, Routes, Route, Redirect } from "react-router-dom";


function App() {
  return (
    <main>
      <Router></Router>

      <Routes>
        <Route path="/" component={HomePage} exact />
      </Routes>
    </main>
  );
}

export default App;
